function setup() {
  createCanvas(900, 700);
  colors.push(color(86, 158, 165, 255));
  colors.push(color(0, 107, 118, 255));
  colors.push(color(255, 196, 0, 255));
  colors.push(color(241, 147, 120, 255));
  colors.push(color(224, 65, 43, 255));
  colors.push(color(99, 132, 105, 255));
  ColorFill_button = createButton("Color Fill");
  ColorFill_button.position(width - 100, height - 250);
  ColorFill_button.mouseClicked(fill_with_color);
  SaveOut_button = createButton("Save");
  SaveOut_button.position(width - 100, height - 150);
  SaveOut_button.mouseClicked(save_out);
  Load_button = createButton(">");
  Load_button.position(width - 200, height - 150);
  Load_button.mouseClicked(load);
  Load_prev_button = createButton("<");
  Load_prev_button.position(width - 250, height - 150);
  Load_prev_button.mouseClicked(loadprev);

  initial_data = split(initialize, ",");
  // writer = createWriter("design_data.txt");
  for (let i = 0; i < 16; i++) {
    for (let j = 0; j < 48; j++) {
      balls.push(new Ball(i, j));
    }
  }

  for (let i = 0; i < balls.length; i++) {
    balls[i].color_index = initial_data[i];
    // balls[i].color_index = floor(random(5));
    // balls[i].color_index = (i * 21) % 2;

    //     if(i%6==0 || (i>48*0 && i<48*1)|| (i>48*5 && i<48*6)|| (i>48*10 && i<48*11)|| (i>48*15 && i<48*16)){

    //       balls[i].color_index = i%5;
    //     } else {
    //     balls[i].color_index = floor(random(2,5));
    //     }
  }

  for (let i = 0; i < colors.length; i++) {
    pickers.push(new ColorPicker(i, 0, colors[i], i));
  }
  noStroke();
}

function draw() {
  background(255);
  for (let i = 0; i < balls.length; i++) {
    balls[i].display();
    // balls[i].display_label();
  }

  for (let i = 0; i < pickers.length; i++) {
    pickers[i].display();
  }

  if (mouseIsPressed) {
    for (let i = 0; i < balls.length; i++) {
      balls[i].check_click();
    }
  }

  countBalls();
  fill(150);
  text(load_index, width-150,height-130)
}

function countBalls() {
  let [bl, vs, y, sr, o, ww] = [0, 0, 0, 0, 0, 0];
  for (let i = 0; i < balls.length; i++) {
    if (balls[i].color_index == 0) {
      bl++;
    } else if (balls[i].color_index == 1) {
      vs++;
    } else if (balls[i].color_index == 2) {
      y++;
    } else if (balls[i].color_index == 3) {
      sr++;
    } else if (balls[i].color_index == 4) {
      o++;
    } else if (balls[i].color_index == 5) {
      ww++;
    }
  }
  let position = createVector(100, height - 200);
  let offset = 32;
  fill(0);
  textSize(32);
  if(bl>color_limits[0]){fill(255,0,0);}else{fill(0);}
  text("Blue Lake: " + bl + "/"+color_limits[0], position.x, position.y);
  if(vs>color_limits[1]){fill(255,0,0);}else{fill(0);}
  text("Venesualean Sea: " + vs + "/"+color_limits[1], position.x, position.y + offset * 1);
  if(y>color_limits[2]){fill(255,0,0);}else{fill(0);}
  text("Lemon: " + y + "/"+color_limits[2], position.x, position.y + offset * 2);
  if(sr>color_limits[3]){fill(255,0,0);}else{fill(0);}
  text("Salmon Run: " + sr+ "/"+color_limits[3], position.x, position.y + offset * 3);
  if(o>color_limits[4]){fill(255,0,0);}else{fill(0);}
  text("Orange: " + o + "/"+color_limits[4], position.x, position.y + offset * 4);
  if(ww>color_limits[5]){fill(255,0,0);}else{fill(0);}
  text("Weeping Willow: " + ww+ "/"+color_limits[5], position.x, position.y + offset * 5);
}

function countColor() {
  let count = 0;
  for (let i = 0; i < balls.length; i++) {
    if (balls[i].color_index == active_color) {
      count++;
    }
  }

  return count;
}

function mouseClicked() {
  for (let i = 0; i < balls.length; i++) {
    balls[i].check_click();
  }
  for (let i = 0; i < pickers.length; i++) {
    pickers[i].check_click();
  }
}

function fill_with_color() {
  for (let i = 0; i < balls.length; i++) {
    balls[i].color_index = active_color;
  }
}

function save_out() {
  let this_time =
    str(month()) +
    "-" +
    str(day()) +
    "-" +
    str(year()) +
    "_" +
    str(hour()) +
    "-" +
    str(minute()) +
    "-" +
    str(second());
  // let writer = createWriter("PS_" + this_time+".txt");
  let sequence = "";
  for (let i = 0; i < balls.length; i++) {
    sequence += balls[i].color_index + ",";
  }
  // writer.write(sequence);
  print(str(sequence));
  // writer.close();
}

function load() {
  load_index++;
  if (load_index >= load_slot.length) {
    load_index = 0;
  }
  let load_data = split(load_slot[load_index][0], ",");
  for (let i = 0; i < balls.length; i++) {
    balls[i].color_index = load_data[i];
  }
}

function loadprev() {
  load_index--;
  if (load_index < 0) {
    load_index = load_slot.length-1;
  }
  let load_data = split(load_slot[load_index][0], ",");
  for (let i = 0; i < balls.length; i++) {
    balls[i].color_index = load_data[i];
  }
}

class ColorPicker {
  constructor(x, y, color, color_index) {
    this.picker_size = 30;
    this.position = createVector(width / 1.5, height / 1.5);
    this.location = createVector(
      x * this.picker_size + this.picker_size / 2 + this.position.x,
      y + this.position.y
    );
    this.color = color;
    this.color_index = color_index;
  }

  display() {
    fill(this.color);
    noStroke();
    ellipse(
      this.location.x,
      this.location.y,
      this.picker_size,
      this.picker_size
    );
    if (active_color == this.color_index) {
      fill(0);
      ellipse(
        this.location.x,
        this.location.y,
        this.picker_size / 2,
        this.picker_size / 2
      );
    }
  }
  check_click() {
    if (
      dist(mouseX, mouseY, this.location.x, this.location.y) <
      this.picker_size / 2
    ) {
      active_color = this.color_index;
    }
  }
}

class Ball {
  constructor(y, x) {
    this.padding = 10;
    this.ball_size = (width - this.padding * 2) / 48;
    this.location = createVector(
      x * this.ball_size + this.ball_size / 2,
      y * this.ball_size + this.ball_size / 2
    );
    this.color_index = 0;
    this.color_name = "";

    //venezualean sea 0 107,118
    //blue lake. 86,158,165
    //salmon run : 241,147,120
    //orange 224,65,43
    //lemon 255,196,0
    //weeping willow. 99,132,105
  }

  display() {
    noStroke();
    fill(colors[this.color_index]);
    // noFill();
    // stroke(0);
    strokeWeight(0.5)
    ellipse(
      this.location.x + this.padding,
      this.location.y + this.padding,
      this.ball_size,
      this.ball_size
    );
  }

  display_label() {
    
    fill(0);
    textSize(10);
    textAlign(CENTER);
    if (this.color_index == 0) {
      text(
        "lb",
        this.location.x + this.padding,
        this.location.y + this.padding + 3
      );
    } else if(this.color_index == 1){
      text(
        "db",
        this.location.x + this.padding,
        this.location.y + this.padding + 3
      );
    } else if(this.color_index == 2){
      text(
        "Y",
        this.location.x + this.padding,
        this.location.y + this.padding + 3
      );
    } else if(this.color_index == 3){
      text(
        "P",
        this.location.x + this.padding,
        this.location.y + this.padding + 3
      );
    } else if(this.color_index == 4){
      text(
        "R",
        this.location.x + this.padding,
        this.location.y + this.padding + 3
      );
    } else if(this.color_index == 5){
      text(
        "g",
        this.location.x + this.padding,
        this.location.y + this.padding + 3
      );
    } 
  }

  check_click() {
    if (
      dist(
        mouseX - this.padding,
        mouseY - this.padding,
        this.location.x,
        this.location.y
      ) <
      this.ball_size / 2
    ) {
      // if (countColor() < color_limits[active_color]) {
        this.color_index = active_color;
      // }
      if (this.color_index > 5) this.color_index = 0;
    }
  }
}
